import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';

// import { Container, Row, Col } from 'react-bootstrap';
import { Link, Route, Switch } from 'react-router-dom';


//Pages
// import Root from './components/ProfilePage/ProfilePage';
// import ContentItemPage from './components/ContentItemPage/ContentItemPage';
import ProfilePage from './ProfilePage/ProfilePage';

//Components
// import {Navbar} from './components/Navbar/Navbar';
// import {ProfileCard} from './components/ProfileCard/ProfileCard';
// import {ProfileButtons} from './components/ProfileButtons/ProfileButtons';
// import {AboutMe} from './components/AboutMe/AboutMe';





function App() {
  return (
    <div className="App">
      <header className="App-header">
        {/* <ProfilePage /> */}
        <Route component={ProfilePage} path="/profilepage" />
        {/* <Switch>
          <Route component={ProfilePage} exact path="/profilepage" />
          <Route component={ContentItemPage} exact path="/ContentItemPage" />
        </Switch> */}
      </header>
    </div>
  );
}

export default App;
